    <main class="container ms-0">
      <div class="row vw-100 vh-75">
        <div class="col-5 d-flex align-items-center">
            <div class="d-flex flex-column m-5 p-5">
                <h3 class="p-3">
                    Login with Kundelik.kz
                </h3>
                <p class="p-3 fs-5">
                    If you are a <strong class="text-primary">Student</strong>, enter your account with Kundelik.kz, and if you are an <strong class="text-primary">Administrator</strong> of an educational institution, enter your <strong>corporate email</strong>
                </p>
                <form th:action="@{/login}" method="POST">                
                    <div class="form-floating my-2">
                      <input class="form-control" id="floatingInput" name="username" placeholder="name@example.com">
                      <label for="floatingInput">Username or email</label>
                    </div>
                    <div class="form-floating my-2">
                      <input type="password" class="form-control" id="floatingPassword"  name="password" placeholder="Password">
                      <label for="floatingPassword">Password</label>
                    </div>
                    <div th:if="${param.error}" class="container my-2 text-danger">
                        *Wrong username or password 
                    </div>
                    <button class="w-100 btn btn-lg btn-primary" type="submit">Sign in</button>
                </form>
            </div>
        </div>
